    (masterpiece:1.2, best quality), (ultra-detailed), (illustration), 
    (ultra highres), (delicate illustration), (hyper-detailed), 
    (super detail:1.3), professional lighting, cinematic lighting, 
    (nostalgia and peacefulness:1.3), professional (landscape painting) of natures, 
    moon lighting, moon light on trees leaves, (dark cloud, dark night, full moon, dark lighting)
