    human, man, woman, people, person, (worst quality:1.4), (low quality:1.4), 
    (EasyNegative:1.0), paintings, sketches, (normal quality:2), lowres, 
    normal quality, ((monochrome)), ((grayscale)), 
    jpeg artifacts, signature, watermark, username, 
